import React from 'react'
import Menu from '../components/menu';
import data from '../data';

export default function HomeScreen() {
    return (<div>
        <div className="row center">
            {
                data.menus.map((menu) => (
                    <Menu key={menu._id} menu={menu}></Menu>
                ))
            }


        </div>
    </div>);


}
